import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import cultureimg2 from "../img/hab-image-2.jpg";
import cultureimg3 from "../img/hab-image-3.jpg";

const ImageCarousel = ({ autoplaySpeeds }) => {
  const settings = {
    dots: false,
    infinite: true,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    fade: true,
    arrows: false,
    autoplaySpeed: autoplaySpeeds[0] || 5000, // Default speed for the first slide
    speed: 500,
    beforeChange: (current, next) => {
      // Update autoplaySpeed before each slide change
      settings.autoplaySpeed = autoplaySpeeds[next] || 5000; // Use the speed for the next slide
    },
  };

  return (
    <Slider {...settings}>
      <div className="col radius-lg">
        <img
          src={cultureimg2}
          alt="Wow look at this"
          style={{ width: "100%", height: "211px", objectFit: "cover" }}
        />
      </div>
      <div className="col radius-lg">
        <img
          src={cultureimg3}
          alt="and this"
          style={{ width: "100%", height: "211px", objectFit: "cover" }}
        />
      </div>
      {/* Add more slides as needed */}
    </Slider>
  );
};

export default ImageCarousel;
